import { useState, useEffect } from 'react';
import Blogs from './components/Blogs';

const App = () => {

  const [blogs, setBlogs] = useState([
    { title: 'Arto Hellas' }
  ])

  return (
    <div className="App">
      <h1>Blogs</h1>
      <Blogs />
    </div>
  );
}

export default App
